import React from 'react';

const FormularioAsignaturas = (props) => {
    return(
        <div>
        <label>
            {props.value}
                <textarea rows="2" cols="20" style={{resize: 'none'}}/>
        </label>
        </div>
    );
}

export default FormularioAsignaturas;
